import './header.css'

function Header(props) {
    return (
        <article>
            <h2>{props.title}</h2>
            <h2>{props.name}</h2>
            <h2>{props.date}</h2>
            <h2>{props.note}</h2>
            <h2>{props.title}</h2>
        </article>
    )
}

export default Header;
